contracts/manager/Candel_1M/Candel_1M_Ma.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../../interface/ICandleManager.sol";

contract Candle_1M_Manager is ICandleManager {
    mapping(uint256 => CandleResponse) private candles; // Lưu trữ nến theo timestamp
    uint256[] private timestampList; // Danh sách timestamp để lấy dữ liệu

    // Candle[] public candles;
    function recordCandle(CandleRecord calldata kline) external override {
        require(kline.t > 0 && kline.T > kline.t, "Invalid time range");
        require(bytes(kline.s).length > 0, "Symbol is required");

        uint256 timestamp = kline.t; // Sử dụng startTime làm key

        // Tạo CandleResponse
        CandleResponse memory candleResponse = CandleResponse({
            e: "kline", // Giả định event type
            E: block.timestamp, // Thời gian ghi nhận
            s: kline.s, // Symbol
            k: kline
        });

        candles[timestamp] = candleResponse;
        timestampList.push(timestamp);
        // candles.push(CandleResponse);

        emit AddCandleRecord(timestamp, kline.s, kline.o, kline.c);
    }

    function getCandle(uint256 timestamp)
        external
        view
        override
        returns (CandleResponse memory)
    {
        return candles[timestamp];
    }

    function getLastKline()
        external
        view
        override
        returns (CandleResponse memory)
    {
        require(timestampList.length > 0, "No candles recorded");
        uint256 lastTimestamp = timestampList[timestampList.length - 1];
        return candles[lastTimestamp];
    }

    function getAllCandle()
        external
        view
        override
        returns (CandleResponse[] memory)
    {
        CandleResponse[] memory result = new CandleResponse[](
            timestampList.length
        );
        for (uint256 i = 0; i < timestampList.length; i++) {
            result[i] = result[timestampList[i]];
        }
        return result;
    }

    function getLength() public view returns (uint256) {
        return timestampList.length;
    }

}

contracts/interface/ICandleManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../struct/CandleStruct.sol";
interface ICandleManager {
    event AddCandleRecord(uint256 timestamp, string symbol, uint256 open, uint256 close);
    
    function recordCandle(CandleRecord calldata kline) external;
    function getCandle(uint256 timestamp) external view returns (CandleResponse memory);
    function getLastKline() external view returns (CandleResponse memory);
    function getAllCandle() external  view returns (CandleResponse[] memory);
    // function getKlinesPaginated(uint256 startTimestamp, uint256 limit, uint256 offset) external view  returns (CandleRecord[] memory);
}

contracts/struct/CandleStruct.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
// thiếu name 
struct CandleRecord {
    uint256 t;    // startTime
    uint256 T;    // endTime
    string s;    // symbol
    string i;      // interval
    uint256 f;    // firstTradeId
    uint256 L;    // lastTradeId
    uint256 o;    // open
    uint256 c;    // close
    uint256 h;    // high
    uint256 l;    // low
    uint256 v;    // volume
    uint256 n;    // trades
    bool x;       // x (no change since name and comment are the same)
    uint256 q;    // quoteVolume
    uint256 V;    // takerBuyVolume
    uint256 Q;    // takerBuyQuoteVol
    string B;     // ignoredField
}

struct CandleResponse {
    string e; //
    uint E;
    string s ; // symbol
    CandleRecord k;
}

